import React, { Component } from "react";
import "./TourList.scss";
import Tour from "../Tour/Tour";
import tourData from "../tourData";

export default class TourList extends Component {
  sate = {
    tours: tourData
  };
  render() {
    return (
      <section className="tourlist">
        <Tour />
      </section>
    );
  }
}
